/**
 * @param {number} n
 * @param {number[][]} offers
 * @return {number}
 */
var maximizeTheProfit = function(n, offers) {
    offers.sort((a, b) => a[1] - b[1]); // Sort offers based on the end index
    const dp = new Array(n).fill(0); // dp[i] represents the max gold we can get by considering up to the i-th house

    for (let i = 0; i < n; i++) {
        dp[i] = (i > 0 ? dp[i-1] : 0); // Initialize dp[i] with dp[i-1] if i > 0
        for (const offer of offers) {
            const [start, end, gold] = offer;
            if (end == i) { // If the offer ends at the i-th house
                const goldIfTaken = gold + (start > 0 ? dp[start-1] : 0); // Gold if we take this offer
                dp[i] = Math.max(dp[i], goldIfTaken); // Maximize the gold
            }
        }
    }

    return dp[n-1]; // The maximum gold can be obtained by selling up to the (n-1)-th house
};
